import { Text, View } from "react-native";
export default function App() {
  return (
    <View style={{
      flex: 1,
      backgroundColor:'#131016'
    }}>
      <Text >Leo de Paula</Text>
      <Text >Software engineer</Text>
    </View>
  );
}
